            >
              <i className="bi bi-telegram text-secondary"></i>
            </a>
          </div>
        )}
      </div>
    </div>
    {showEditButton && (
      <a
        href="#/mob.near/widget/ProfileEditor"
        className="profile-edit btn btn-sm btn-outline-secondary border-0 align-top"
      >
        Edit
      </a>
    )}
